import React from 'react';
import styled from 'styled-components';
import Button from '../../lib/Button';
import { useNavigate } from 'react-router-dom';

const Div = styled.div`
  width: 33%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
`;

const SelectLeft = () => {
  const nav = useNavigate();

  const goNowPlayings = () => {
    nav('/nowplayings');
  };

  const goUpComings = () => {
    nav('/upcomings');
  };

  const goOtts = () => {
    nav('/otts');
  };
  return (
    <Div>
      <button onClick={goNowPlayings}>
        <span>최신 상영작</span>
        <p>* 개봉한지 2주일 안의 영화만 보여줍니다.</p>
      </button>
      <button onClick={goUpComings}>
        <span>개봉 예정작</span>
        <P></P>
      </button>
      <button onClick={goOtts}>
        <span>Otts</span>
      </button>
    </Div>
  );
};

export default SelectLeft;
